members.member:
Creates initiator fix session.
User can use StandardFixSessionFactory.GetFactory(SessionParameters).CreateInitiatorSession(SessionParameters) instead this method.
@deprecated use or instead

member.summary:
The method checks if TR send or received.
If session is not received any messages during HB interval the HB will be send and If no response received session will be disconnected;
This is helper method for session task.

The next handler calls only: 1. if message starts with 8 tag;
2. if the second tag is 9.
3. if the third tag is 35

Gets expected sequence number.


If in the session  attribute is set the seq number takes from it;
Otherwise if processed seq number is set in the session parameters the expected seq num takes from it;
Otherwise the seq number takes from incoming seq num.

Save session parameters in file.
If session attribute  is set the incoming seq num will be saved;
And if sessionParameters.GetProcessedIncomingSequenceNumber() is set the last processed seq num will be saved;

Persistent queue file format is the following: 

1 byte record length length [n]; 

n bytes record length [m] 

m bytes record itself 

DELETE marker is byte == (byte)0;
